import React, {Component} from 'react'

class Bottom extends Component{
    render(){
        return(
            <div className="App">
                <footer style={footerStyle} className="bottomContainer">
                    <h4>Support Policys Cookies</h4><img src="/test-static/stripe.png" alt="Failed to load"/>
                </footer>
            </div>
        )
    }
}

const footerStyle = {
    postion: "absolute",
    bottom: "0%"
}
export default Bottom;
